import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <nav className="navbar bg-primary">
        <h1>
          Github React App <i className="fab fa-github" />
        </h1>
      </nav>
    );
  }
}

export default Navbar;
